import BpmnModeler from 'bpmn-js/lib/Modeler';

export default function BPMNContainer() {
  var containerRef = React.createRef();
  var modeler = new BpmnModeler({
    container: containerRef
  });
  return (
    <React.Fragment>
      <div ref={containerRef}></div>
    </React.Fragment>
  );
}
